    public partial class MainWindow
    {
        private readonly BackgroundWorker _worker;
        private byte[] _originalBytes;
        private byte[] _markedBytes = new byte[0];
        private byte[] _unMarkedBytes = new byte[0];

        private int[] _markedIndexes;
        private int[] _unMarkedIndexes;

        private Mode _mode;
        private string _result;
        private int _scale;

        private int Scale
        {
            get { return _scale; }
            set
            {
                if (_scale != value)
                {
                    _scale = value;
                    DrawVisiblePart();
                }
            }
        }

        private double Center
        {
            get { return Canvas.ActualHeight/2.0; }
        }

        private double VerticalOffset
        {
            get { return Center - 5; }
        }

        public MainWindow()
        {
            InitializeComponent();

            _worker = new BackgroundWorker();
            _worker.DoWork += WorkerDoWork;
            _worker.RunWorkerCompleted += WorkerRunWorkerCompleted;
        }

        private void MainWindowSizeChanged(object sender, SizeChangedEventArgs e)
        {
            DrawVisiblePart();
        }

        private void ScrollViewerScrollChanged(object sender, ScrollChangedEventArgs e)
        {
            DrawVisiblePart();
        }

        private void ScaleSliderValueChanged(object sender, RoutedPropertyChangedEventArgs<double> e)
        {
            Scale = (int) e.NewValue;
        }

        private void WorkerDoWork(object sender, DoWorkEventArgs e)
        {
            var waterMark = e.Argument.ToString();
            var helper = new AudioProcessorHelper(waterMark, _mode);
            _result = helper.Process(GetBytes(), out _markedBytes, out _unMarkedBytes, out _markedIndexes, out _unMarkedIndexes);
        }

        private void WorkerRunWorkerCompleted(object sender, RunWorkerCompletedEventArgs e)
        {
            Title = _result;
            DrawVisiblePart();
        }

        private void Draw(List<short> points, double offset, Brush pointBrush, Brush lineBrush)
        {
            // Draw center line
            var horizontalLine = new Line
            {
                X1 = offset*Scale,
                X2 = (offset + points.Count)*_scale,
                Y1 = Center,
                Y2 = Center,
                Stroke = Brushes.White,
                StrokeThickness = 0.1,
                IsHitTestVisible = false
            };
            Panel.SetZIndex(horizontalLine, int.MinValue);
            Canvas.Children.Add(horizontalLine);

            // Draw original points and lines (signal)
            for (var i = 1; i < points.Count; i++)
            {
                double left1 = (i - 1 + offset)*Scale;
                double left2 = (i + offset)*Scale;
                double top1 = Center + VerticalOffset*points[i - 1]/Int16.MaxValue;
                double top2 = Center + VerticalOffset*points[i]/Int16.MaxValue;

                var line = new Line
                {
                    X1 = left1,
                    X2 = left2,
                    Y1 = top1,
                    Y2 = top2,
                    Stroke = lineBrush,
                    StrokeThickness = 1,
                    IsHitTestVisible = false,
                };
                Panel.SetZIndex(line, int.MinValue);
                Canvas.Children.Add(line);

                Canvas.Children.Add(CreateSpot(left2, top2, string.Format("{0:0}: 0x{1}", i + offset, points[i].ToString("X4")), pointBrush));
            }
        }

        private void DrawVisiblePart()
        {
            var points = GetPoints(GetBytes());

            Canvas.Width = points.Count*Scale;

            var pointsOffset = ScrollViewer.HorizontalOffset/Scale;
            var visiblePointsCount = ActualWidth/Scale;

            if (pointsOffset + visiblePointsCount > points.Count)
            {
                pointsOffset = points.Count - visiblePointsCount;
            }

            var pointsCount = points.Count < visiblePointsCount ? points.Count : (int) visiblePointsCount;

            Canvas.Children.Clear();

            Draw(points.GetRange((int) pointsOffset, pointsCount), pointsOffset, Brushes.White, Brushes.LawnGreen);

            if (_markedBytes.Length != 0 && _unMarkedBytes.Length != 0)
            {
                DrawPoints(GetPoints(_markedBytes).GetRange((int) pointsOffset, pointsCount), pointsOffset,
                    Brushes.LightSkyBlue, _markedIndexes, 10);
                DrawPoints(GetPoints(_unMarkedBytes).GetRange((int) pointsOffset, pointsCount), pointsOffset,
                    Brushes.Red,
                    _unMarkedIndexes, 15);
            }
        }

        private void DrawPoints(IList<short> points, double offset, Brush pointBrush, int[] indexes, double diameter)
        {
            for (var i = 0; i < points.Count; i++)
            {
                if (indexes.Contains(((int) (i + offset))))
                {
                    double left = (i + offset)*Scale;
                    double top = Center + VerticalOffset*points[i]/Int16.MaxValue;

                    Canvas.Children.Add(CreateSpot(left, top, string.Format("{0:0}: {1}", i + offset, points[i]),
                        pointBrush, false, diameter));
                }
            }
        }

        private UIElement CreateSpot(double left, double top, string toolTipMessage, Brush brush, bool isFilled = true, double diameter = 5)
        {
            double width = diameter;
            double height = diameter;

            var ellipse = new Ellipse
            {
                Stroke = brush,
                Width = width,
                Height = height,
                Fill = isFilled ? brush : Brushes.Transparent,
                Cursor = Cursors.Hand
            };

            ellipse.MouseEnter += ellipse_MouseEnter;
            ellipse.MouseLeave += ellipse_MouseLeave;

            Canvas.SetLeft(ellipse, left - width/2.0);
            Canvas.SetTop(ellipse, top - height/2.0);

            ToolTipService.SetToolTip(ellipse, toolTipMessage);

            return ellipse;
        }

        private void ellipse_MouseEnter(object sender, System.Windows.Input.MouseEventArgs e)
        {
            var ellipse = (sender as Ellipse);

            var top = Canvas.GetTop(ellipse);
            var left = Canvas.GetLeft(ellipse);

            left -= 5;
            top -= 5;

            Canvas.SetTop(ellipse, top);
            Canvas.SetLeft(ellipse, left);

            ellipse.Width += 10;
            ellipse.Height += 10;
        }

        private void ellipse_MouseLeave(object sender, System.Windows.Input.MouseEventArgs e)
        {
            var ellipse = (sender as Ellipse);

            var top = Canvas.GetTop(ellipse);
            var left = Canvas.GetLeft(ellipse);

            left += 5;
            top += 5;

            Canvas.SetTop(ellipse, top);
            Canvas.SetLeft(ellipse, left);

            ellipse.Width -= 10;
            ellipse.Height -= 10;
        }

        private void ProcessButtonClick(object sender, RoutedEventArgs e)
        {
            if (_worker.IsBusy)
            {
                MessageBox.Show("Background process in progress. Please wait.");
                return;
            }
            _worker.RunWorkerAsync(TextBoxWaterMark.Text);
        }

        private void SaveButtonOnClick(object sender, RoutedEventArgs e)
        {
            if (_worker.IsBusy)
            {
                MessageBox.Show("Background process in progress. Please wait.");
                return;
            }

            var saveFileDialog = new SaveFileDialog {Filter = "Wave file|*.wav", Title = "Save an Audio File"};
            saveFileDialog.ShowDialog();

            if (!string.IsNullOrEmpty(saveFileDialog.FileName))
            {
                WAV.Save(saveFileDialog.FileName, GetBytes(), 16000);

                var index = saveFileDialog.FileName.LastIndexOf('.');
                var fileName = saveFileDialog.FileName.Substring(0, index);
                fileName += "Marked" + saveFileDialog.FileName.Substring(index);

                WAV.Save(fileName, _markedBytes, 16000);

                fileName = saveFileDialog.FileName.Substring(0, index);
                fileName += "UnMarked" + saveFileDialog.FileName.Substring(index);

                WAV.Save(fileName, _unMarkedBytes, 16000);
            }
        }

        private void OpenButtonOnClick(object sender, RoutedEventArgs e)
        {
            if (_worker.IsBusy)
            {
                MessageBox.Show("Background process in progress. Please wait.");
                return;
            }

            var openFileDialog = new OpenFileDialog {Filter = "Wave file|*.wav", Title = "Open an Audio File"};

            if (openFileDialog.ShowDialog() == true)
            {
                using (var stream = new MemoryStream())
                {
                    openFileDialog.OpenFile().CopyTo(stream);
                    _originalBytes = stream.GetBuffer();
                }
            }
        }

        private void RadioButtonModeOnChecked(object sender, RoutedEventArgs e)
        {
            var senderName = ((RadioButton) sender).Name;
            switch (senderName)
            {
                case "RadioButtonDirectMode":
                    _mode = Mode.Direct;
                    break;
                case "RadioButtonQuasiMode":
                    _mode = Mode.Quasi;
                    break;
                default:
                    throw new NotImplementedException("Unknown sender name: " + senderName);
            }
        }

        private static List<short> GetPoints(byte[] bytes)
        {
            var points = new List<short>();

            // Header - 44 bytes
            for (var i = 44; i < bytes.Length; i += 2)
            {
                points.Add(Convert.ToInt16(bytes[i].ToString("X2") + bytes[i + 1].ToString("X2"), 16));
            }

            return points;
        }

